import './App.css';
import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './pages/login.tsx';
function App() {
  return (
    <div className="App">
      {/* Wrap Routes in BrowserRouter */}
      <Router>
        <Routes>
          {/* Define Routes for the app */}
          <Route path="/login" element={<Login />} />
          <Route path="/orderSelection" element={<OrderSelection />} />
          <Route path="/dealershipSelection" element={<DealershipSelection />} />
          <Route path="/vehicle-entry" element={<VehicleEntry />} />
          <Route path="/vehicle-list" element={<VehicleList />} />
          <Route path="/single-vehicle-entry" element={<SingleVehicleEntry />} />
        </Routes>
      </Router>
    </div>
  );
}

export default App;
